import React from "react"
import Navbar from "../components/Navbar.js"

function About(){
  return(
    <div className = "row" style={{marginLeft: "5vw", marginRight: "5vw"}}>
      <div className = "col-md-3">
        <Navbar/>
      </div>
      <div className = "col-md-9">
        <h1>About</h1>
      </div>
    </div>
  )
}

export default About;
